import React, { Component } from 'react';
import Regular from './Regular.js'
import './Regular.css'


class App extends Component {

    state = {
        fontColor: 'black',
        bgColor: 'white',
    }

    FrogColor = () => {
        var newFont = 'green';
        var newBG = 'green';
        this.setState({
            fontColor: newFont,
        });
        console.log("font: " + this.state.fontColor + " bg: " + this.state.bgColor);
    }

    render() {
        return (
            <div className="App" style={{background: this.state.bgColor}}>
                <button className="button" onClick={this.FrogColor}>Frog Mode</button>
                <div className="textDiv">
                <div>
                    <title>jodie</title>
                </div>
                <div id="title">
                    <h1 id="name">jodie wei</h1>
                    <h3 id="tagline">software engineer for real, designer for fun<br></br><br></br></h3>
                </div>

                <div id="profile">
                    <p>
                        future:<br></br>
                        software engineer @ google [fall 2019];<br></br><br></br>
                        present:<br></br>
                        computer science + segal design certificate @ northwestern university [2015-2019];<br></br><br></br>

                        past:<br></br>
                        software development intern @ ibm [summer 2018];<br></br>
                        software development intern @ deep dish tech [summer 2017];<br></br><br></br><br></br>
                    </p>
                </div>

                <div id="resume">
                    <p className="header">things i've done<br></br></p>
                    <p className="item">news article analyzer: sentiment analysis using ibm watson<br></br></p>
                    <p className="tab">(takeaways: watson api, natural language understanding, developing an app in 24 hours!!!;)<br></br></p>
                    <p className="item">palm: a redesigned container lid for patients with hand disabilities<br></br></p>
                    <p className="tab">(takeaways: design thinking, prototyping, user testing, keeping fingers safe while sawing apart plastic and metal);<br></br></p>
                    <p className="item">mealhop: a food ordering coordinater for your chat group<br></br></p>
                    <p className="tab">(takeaways: javascript, using an api [cisco spark], developing an mvp in 36 hours, taking strategic snack breaks, my very first hackathon!);<br></br></p>
                    <p className="item">backend and database for brew bike coffee's mobile app <br></br></p>
                    <p className="tab">(takeaways: mongodb, node.js, working with clients);<br></br></p>
                    <p className="item">user-friendly interface for emotionalytics, a mood-tracking app<br></br></p>
                    <p className="tab">(takeaways: wireframing, user testing, front-end dev);<br></br></p>
                </div>
            </div>
            </div>
        );
    }
}

export default App;
